import React from "react";
import Test from "./Test";

class Test2 extends React.Component {
  constructor() {
    super();
    this.state = {
      greeting: "Hi Parent",
    };
	this.greetingFun = this.greetingFun.bind(this);
  }
	greetingFun(childArg) {
		alert(`${this.state.greeting} ${childArg}`)
	}
	render() {
		return(
		<div>
			<Test greetHandler = {this.greetingFun}/>
		</div>)
	}
}

export default Test2;
